import logo from "../../assets/images/logo.jpeg";
const Header = () => {
  return (
    <div className={classes.headercontainer}>
      <div>
        <img src={logo} alt="" />
      </div>
      <ul>
        <li>Home</li>
        <li>News</li>
        <li>Sport</li>
        <li>Reel</li>
        <li>WorkLife</li>
        <li>Travel</li>
        <li>Future</li>
        <li>Culture</li>
      </ul>
    </div>
  );
};
export default Header;
